import './App.css';
import React from "react";
import {
  BrowserRouter as Router,
  Switch,
  Route,
} from "react-router-dom";
import {ArticleList,Layout} from './Components';


function App() {
  return(<Router>
    <Switch>
      <Layout>
              <Route exact path="/:id" children={<ArticleList type="Things To Do" typePlaceholder="Add New Task"/>} />
      <Route path="/" children={<ArticleList type="To Do Bucket List" typePlaceholder="Add New BucketList"/>} />
      </Layout>
    </Switch>
  </Router>
  )
}

export default App;
